lemma octo_eqI [intro?]:
  "\<lbrakk>Ree x = Ree y; Im1 x = Im1 y; Im2 x = Im2 y; Im3 x = Im3 y;
    Im4 x = Im4 y;Im5 x = Im5 y;  Im6 x = Im6 y; Im7 x = Im7 y\<rbrakk> \<Longrightarrow> x = y"

