lemma (in Module) unique_expression_last:" \<lbrakk>free_generator R M H; 
        f \<in> {j. j \<le> Suc n} \<rightarrow> H; s \<in> {j. j \<le> Suc n} \<rightarrow> carrier R;
        g \<in> {j. j \<le> Suc n} \<rightarrow> H; t \<in> {j. j \<le> Suc n} \<rightarrow> carrier R;
        l_comb R M (Suc n) s f = l_comb R M (Suc n) t g; 
        inj_on f {j. j \<le> Suc n}; inj_on g {j. j \<le> Suc n}; 
        f (Suc n) = g (Suc n)\<rbrakk>  \<Longrightarrow> s (Suc n) = t (Suc n)"

lemma seqp_broadcastTE [elim]:
  "\<lbrakk>((\<xi>, {l}broadcast(s\<^sub>m\<^sub>s\<^sub>g). p), a, (\<xi>', q)) \<in> seqp_sos \<Gamma>;
    \<lbrakk>a = broadcast (s\<^sub>m\<^sub>s\<^sub>g \<xi>); \<xi>' = \<xi>; q = p\<rbrakk> \<Longrightarrow> P\<rbrakk> \<Longrightarrow> P"

lemma (in eflowgraph) iso_ret_no_ret: "!!u c. \<lbrakk> 
    isolated_ret fg p; 
    proc_of fg u = p; 
    u \<noteq> return fg p; 
    (([u],c),w,([return fg p'],c'))\<in>trcl (trss fg) 
  \<rbrakk> \<Longrightarrow> False"

